    //创建物理材质
    physicalMaterial = new _cannonEs.Material("slipperyMaterial");
    //创建物理材质的接触材质
    var contactMaterial = new _cannonEs.ContactMaterial(physicalMaterial, physicalMaterial, {
        friction: 0.3,
        restitution: 0
    });
