//创建threejs地面
function createGround(physicalMaterial, world) {
    //创建地面
    var groundShape = new _cannonEs.Plane();
    groundBody = new _cannonEs.Body({
        mass: 0,
        material: physicalMaterial
    });
    groundBody.addShape(groundShape);
    groundBody.position.set(0, 0, 0);
    groundBody.quaternion.setFromAxisAngle(new _cannonEs.Vec3(1, 0, 0), -Math.PI / 2);
    world.addBody(groundBody);
    var groundTexture = new _three.TextureLoader().load("./models/caodi.jpg");
    groundTexture.wrapS = groundTexture.wrapT = _three.RepeatWrapping;
    groundTexture.repeat.set(800, 800);
    groundTexture.anisotropy = 16;
    var groundMaterial = new _three.MeshBasicMaterial({
        map: groundTexture,
        side: _three.DoubleSide
    });
    const planeGeometry = new _three.PlaneGeometry(20000, 20000, 1, 1);
    planeMesh = new _three.Mesh(planeGeometry, groundMaterial);
    planeMesh.name = "ground";
    planeMesh.receiveShadow = true;
    planeMesh.position.copy(groundBody.position);
    planeMesh.quaternion.copy(groundBody.quaternion);
    planeMesh.visible = true;
    group.add(planeMesh);
}
