    for(var i = 0; i < animations.length; i++){
        let clip = animations[i];
        let name = clip.name;
        const action = mixer.clipAction(clip);
        actions[name] = action;
        if (name == "Walk" || name == "_Idle" || name == "Run") {
            action.clampWhenFinished = false;
            action.loop = _three.LoopRepeat;
        } else {
            if (name == "jump") action.clampWhenFinished = true;
            else action.clampWhenFinished = false;
            action.loop = _three.LoopOnce;
        }
    }
    //默认播放站立的动画
    idleAction = actions["_Idle"];
    //走路动画
    walkAction = actions["Walk"];
    //跑动动画
    runAction = actions["Run"];
    //播放站立的状态
    activeAction = idleAction;
    activeAction.play();
